function prover()
{
   this.proof_staus = 'Proof failed.. (current progress)' // report closest (Hamming)
   this.lhs
   this.rhs
   this.axioms = includes
   this.parseDiGraph = function(){
      var result
      var EXIT_SUCCESS = true
      try{
         proofStack.push(buffer[0].val) // init'z stack //
         buffer.map(function(v,i,me){
            if (i<me.length-1)
            {
               if(parser[buffer[i].tok])
               {
                  parser[buffer[i].tok](i)
                  return v
               }
               else
               {
                  parser['44CDEB54C6F2AEBAD54611201C26D6F0'](buffer[i].tok,parser['7F2DB423A49B305459147332FB01CF87'][i].tok)
                  result = false
               }
            }
         })
         var status = {
            true:function(){ return 'Matching number of '+arguments[0]+' \n' },
            false:function(){ return '' }
         }
         EXIT_FAILURE = 
         status[(stack.parens!=0)]('parenthesis')+
         status[(stack.brackets!=0)]('square brackets')+
         status[(stack.braces!=0)]('curly braces')
         if(EXIT_FAILURE){
            parser['44CDEB54C6F2AEBAD54611201C26D6F0']('non'+EXIT_FAILURE,EXIT_FAILURE)
            result = false
         }
         else
         {
            result = EXIT_SUCCESS
         }
         return result
      } catch (e) {
         console.log(e)
         return false
      }
   }
   this.buildDiGraph = function(){
      var parseDG = false
      var parameterList = PARAMETER_LIST
      var codeUpperBody  = CODE_UPPER_BODY
      var codeMidBody = CODE_MID_BODY
      var codeLowerBody  = CODE_LOWER_BODY
      this.axioms.map(function(curVertex,i,me){
         if(i<me.length-1){
            var nextVertex = me[i+1]
            var codebody = codeUpperBody+inQuotes(nextVertex.tok)+codeMidBody+inQuotes(nextVertex.tok)+codeLowerBody
            if(!parser[curVertex.tok]){
               parser[curVertex.tok] = new Function(parameterList,codebody)
            } else {
               codebody = parser[curVertex.tok].toSource()
               codebody = codebody.match(/\{.*\}/)[0]
               var n = codebody.match(/length:(\d+)/)[1]*1
               n++
               newSection = codebody.replace(/length:\d+/,inQuotes(nextVertex.tok)+':parser['+inQuotes(nextVertex.tok)+'],length:'+n)
               parser[curVertex.tok] = new Function(parameterList,newSection)
            }
         } else {
            var codebody = CODE_NULL
            if(!parser[curVertex.tok]){
               parser[curVertex.tok] = new Function(parameterList,codebody)
            }
         }
         return curVertex
      })
      parseDG = true
      return parseDG
   }
   this.verifyAxioms = function(){
      try{
         var proof = []
         var parseDG = this.buildDiGraph()
         if(parseDG && this.parseDiGraph()){
            this.proof_staus = 'Proof found!'
         } else {
            throw '*** Parsing error *** -  Euclid is unable to build Axiom model. Please review input file.'
         }
         return proof
      } catch(e) {
         if(e.message){
            e = OnError(e)
         }
         return [ e ]
      }
   }
   this.prove = function(statements){
      var proof = this.verifyAxioms()
      proof.unshift(this.proof_staus)
      return proof
   }
}
